AO_AGENT_INPUT_SQL_SLCT=SELECT AGT.SkillTargetID as "Agent ACD ID",P.LastName "Agent Last Name",P.FirstName as "Agent First Name", Case when A.EnterpriseName like '%LARA%' then 'SOA Hampton_LARA' when A.EnterpriseName like '%MAMH%' then 'SOA Hampton_MAMH' when A.EnterpriseName like '%PACC%' then 'SOA Hampton_PACC' when A.EnterpriseName like '%VAML%' then 'SOA Hampton_VAML' else 'SOA Hampton' end  as "Project Name"
AO_AGENT_INPUT_SQL_FROM=FROM maxco_awdb.dbo.Agent AGT JOIN  maxco_awdb.dbo.Person P on AGT.PersonID = P.PersonID join maxco_awdb.dbo.Agent_Desk_Settings A on AGT.AgentDeskSettingsID = A.AgentDeskSettingsID
AO_AGENT_INPUT_SQL_WHERE=WHERE AGT.AgentDeskSettingsID in(5076, 5077, 5090, 5104, 5113) 
AO_AGENT_INPUT_SQL_WHERE2=and exists (select 1 from ${DB_ACD_CISCO_NAME}.dbo.Agent_Skill_Group_Interval ASGIS where ASGIS.SkillTargetID = AGT.SkillTargetID 
AO_AGENT_INPUT_SQL_WHERE3=and CAST(Convert(VARCHAR(8),ASGIS.DateTime ,112) as INT) >= ${START_DATE} and CAST(Convert(VARCHAR(8),ASGIS.DateTime ,112) as INT) <= ${END_DATE})
